import React from "react";

export default function Skills() {
  return (
    <section className="max-w-4xl mx-auto mb-10 p-6 bg-white rounded-xl shadow-md">
      <h2 className="text-3xl font-semibold border-b pb-2 mb-4 text-purple-600">Technical Skills</h2>
      <ul className="list-disc list-inside text-gray-700 space-y-2">
        <li><strong>Frontend:</strong> HTML, CSS, JavaScript</li>
        <li><strong>Framework:</strong> React.js (Beginner)</li>
        <li><strong>Programming:</strong> C, Java</li>
        <li><strong>Database:</strong> MySQL</li>
        <li><strong>Tools:</strong> Figma, Git, GitHub</li>
        <li><strong>Others:</strong> Basics of AI and ML</li>
      </ul>
    </section>
  );
}
